import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 10.1-415 Rappahannock State Scenic River.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-415.md","filePath":"vacode/10.1-415.md"}'),n={name:"vacode/10.1-415.md"},i=r('<h1 id="§-10-1-415-rappahannock-state-scenic-river" tabindex="-1">§ 10.1-415 Rappahannock State Scenic River. <a class="header-anchor" href="#§-10-1-415-rappahannock-state-scenic-river" aria-label="Permalink to &quot;§ 10.1-415 Rappahannock State Scenic River.&quot;">​</a></h1><p>The mainstem of the Rappahannock River in Rappahannock, Culpeper, Fauquier, Stafford, Spotsylvania, Caroline, King George, Westmoreland, Essex, and Richmond Counties and the City of Fredericksburg from its headwaters near Chester Gap to the Essex-Middlesex and Richmond-Lancaster County lines, a distance of approximately 165 river miles, is hereby designated as the Rappahannock State Scenic River, a component of the Virginia Scenic Rivers System.</p><p>1985, c. 124, § 10-173.8; 1988, c. 891; 1990, c. 225; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0240" target="_blank" rel="noreferrer">240</a>; 2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0273" target="_blank" rel="noreferrer">273</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0399" target="_blank" rel="noreferrer">399</a>.</p>',3),c=[i];function o(s,p,h,l,d,_){return a(),t("div",null,c)}const v=e(n,[["render",o]]);export{g as __pageData,v as default};
